import './styles/ColumnBar.css'

export default function ColumnBar() {
  return (
    <div>
          <div className='ColumnBarLayout'>

          <button className='SaleButtonLayout'>Sale</button>
            <button className='RentButtonLayout'>Rent</button>
          </div>
    </div>
  )
}
